import { Routes, Route } from "react-router-dom";
import "./App.css";
import Home from "./pages/Home";
import Navbar from "./component/Navbar"; // ✅ Inside src/


function App() {
  return (
    <Routes>
      <Navbar />
      <Route path="/" element={<Home />} />
    </Routes>
  );
}

export default App;
